    "2013-03-15T23:44:40.287108",nt"name": "interpreted-geologic-history-of-the-sedro-woolley-north-and-lyman-7-5-minute-quadrangles-wester",nt"isopen":
    false,nt"url": null,nt"notes": "Interpreted geologic history of the Sedro-Woolley
    North and Lyman 7.5-minute quadrangles, western Skagit County, Washington, Open
    File Report  2000-1.This report presents our interpretation of the geologic history
    of a significant portion of the lower Skagit Valley, focusing on t.he area in and
    near the Sedro-Woolley North and Lyman 7.S-minute quadrangles. Our interpretation
    is based on detailed geologicmapping in and around the Bow, Alger, Sedro-Woolley
    North, and Lyman 7.S-minute quadrangles from 1997 to 1999 (FIg. 1). We also present
    some of our structural and geochemical data from the 1996/97 study of the Kendall
    and Deming 7.S-minutenquadrangles (Fig. 1). This report heavily cites and should
    be accompanied by a companion report-the geologIc map of the Sedro-Woolley North
    and Lyman quadrangles (Dragovich and others, 1999). Both reports borrow information
    from several ongoing studies that are outgrowths of our current mapping. Thesenstudies
    include: (1) Everson Interstade glacIal sedImentary facies analysis and mapping,
    (2) mapping and structural analyses of the nappe emplacement deformation in the
    Northwest Cascades system, and (3) mapping, dating, and 3-D modeling of the massive
    Skagit Valley lahar(s). Downloadable zip file includes Plate 1 and Text (PDF) for
    Open File Report  2000-1.",nt"license_title": null,nt"extras": [{ntt"key":
